import React from 'react';
import { openInbox } from '../../api/LibraryClient';
import { User } from '../../models/User';
import { Message } from '../../models/Message';

interface IInboxPageProps {
    owner : User;
}

interface IInboxPageState {
    messages : Message[];
}

export class InboxPage extends React.Component<IInboxPageProps, any> {

    constructor(props : IInboxPageProps) {
        super(props);
        this.state = {
            messages: []
        }
    }

    componentDidMount() {
        openInbox(this.props.owner.writerid);
    }

    render() {
        return (
            <div className="wrap">
                <div className="usercontainer">
                    <h1>Hello</h1>
                </div>
            </div>
        );
    }
}
